frame_eqs_eel:
vol=(bass+mid+treb_att)*.3333;

redsine=.5+.25*bass*sin(time*3);
greensine=.5+.25*mid*sin(time*2);
bluesine=.5+.25*treb*sin(time);

redif=if(above(bass,1.2),redsine,if(above(redif,.95),0,redif*.85));
greenif=if(above(mid,1.2),greensine,if(above(greenif,.95),0,greenif*.85));
blueif=if(above(treb,1.2),bluesine,if(above(blueif,.95),0,blueif*.85));

wave_r=redif;
wave_g=greenif;
wave_b=blueif;

q1=vol;

pixel_eqs_eel:
zoom = zoom + .1*(1*rad)*above(rad,0.4)*below(rad,.5);
zoom = zoom +.04*(sin(28*ang))*below(rad,.3)*above(rad,.25);

rot=.01*sin(time*-.98);

cx=.5+.2*sin(time*.98);
cy=.5+.2*sin(time*.62);

rot=rot+above(rad,.4)*.1*rad*sin(time*14*rad);

zoom=zoom+above(rad,.4)*.042;

comp:
shader_body { 
 vec3 ret_1;
 vec2 tmpvar_2;
 tmpvar_2.x = cos((uv.x * 37.0));
 tmpvar_2.y = sin((uv.y * 29.0));
 ret_1 = (max (texture (sampler_main, uv).xyz, texture (sampler_main, (uv + 
   (0.001 * tmpvar_2)
 )).xyz) * ((
   (texture (sampler_blur1, uv).xyz * scale1)
  + bias1) * 8.0));
 ret_1 = (ret_1 * ret_1);
 ret_1 = (ret_1 * 0.5);
 vec4 tmpvar_3;
 tmpvar_3.w = 1.0;
 tmpvar_3.xyz = ret_1;
 ret = tmpvar_3.xyz;
}

